import React from 'react';
import MediaItem from '../MediaItem'

const items = [
	{
		title: 'News Article 1',
		date: '1/2/21',
		content: 'Website Has Been Created'
	},
	{
		title: 'News Article 2',
		date: '1/20/21',
		content: 'Made my acting to do list! Check it out Below!'
	},
	{
		title: 'News Article 3',
		date: '2/4/21',
		content: 'Uploaded lot of new videos on my Youtube! Check it out when you get a chance!'
	}
];

const News = () => {
	return (
		<div>
			<MediaItem items={items} />
		</div>

	);
};

export default News;
